import React from 'react';

function Banner(props) {
    return (
        <div className='bannerdiv'>
            I'm banner but no content. QAQ
            <img srcset="image-480w.jpg 480w,
             image-800w.jpg 800w,
             image-1200w.jpg 1200w" src="https://uc.udn.com.tw/photo/2019/08/09/realtime/6671508.jpg" alt="bannerImg"/>
        </div>
    );
}

export default Banner;
